import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';

const CustomNavbar = () => {
  return (
    <Navbar bg="light" expand="lg" className="shadow">
      <Container>
        <Navbar.Brand as={Link} to="/" className="text-success">FitLife</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ml-auto">
            {/* Mantendo o link "Home" */}
            <Nav.Link as={Link} to="/" className="text-success">Home</Nav.Link>
            
            {/* Link para a página de Login */}
            <Nav.Link as={Link} to="/login" className="text-success">Login</Nav.Link>

            {/* Link para "Usuários" */}
            <Nav.Link as={Link} to="/usuarios" className="text-success">Usuários</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default CustomNavbar;
